import React from 'react';
import './sidenav.css';

const SideNav = () => {
	return (
		<nav className="sidebar">
			<p> Sign In </p>
    		<button>
    			<svg class="icon icon-cart" viewBox="0 0 100 100" aria-hidden="true">
    				<path d="./cityscape.svg" />
  				</svg>
    		</button>
    		<img src="./cityscape.svg" width="90" height="50" alt="home" />

		</nav>
	);
}

export default SideNav;
